        "description" to "В центре сюжета картины молодая и жизнерадостная девушка Амели. Все свое детство она провела дома, ведь еще в раннем детстве ей ошибочно диагностировали порок сердца, из-за чего Амели училась дома. Мать героини погибла, после чего отец стал нелюдимым и полностью отгородился от окружающего мира. Но теперь она взрослая, и у нее есть своя собственная жизнь. Амели живет в своей квартире, работает в кафе, и радуется всему, что происходит в ее жизни. Но однажды простой случай меняет ее жизнь кардинальным образом. Она находит в своей квартире детский тайник, принадлежавший жившему там раньше мальчику. Амели решает найти его, и все вернуть. Как приятно было ей наблюдать за безмерной радостью мужчины, который получил свои детские вещи. С этого момента Амели поняла, что она хочет помогать людям, и что это и есть истинный смысл ее жизни.",
