        "description" to "В жизни каждого из нас происходит очень много различных событий, как хороших, так и плохих. Некоторые из них, мы бы с большим удовольствием стерли бы из памяти, но это невозможно. А вот героям картины выпадает такой шанс, ведь в их мире уже придумали такое изобретение, которое позволяет избавиться от не желаемых воспоминаний. Знакомство Джоэля и Клементины было незабываемым, и почти сразу между ними вспыхнули очень сильные чувства. Но со временем их отношения стали принимать иной характер, и появились большие трудности, которые привели к разрыву между влюбленными. Клементина принимает решение полностью стереть все воспоминания, которые хоть как-то связаны с бывшим парнем. Узнав об этом, Джоэль совершает ответный шаг, и стирает все, что связано с любимой. Однако подсознание героя начинает всячески сопротивляться процессу стирания, и процедура начинает идти далеко не по плану.",
