        "description" to "В Акроне, штат Огайо 24-летняя Джой Ньюсам и ее 5-летний сын Джек живут в убогой постройке, которую они называют Комнатой. Они делят кровать, туалет, ванну, телевизор и простую кухню; единственное окно - окно в крыше. Двое являются пленниками человека, которого называют «Старый Ник», биологического отца Джека, который похитил Джой семь лет назад и регулярно насилует ее, пока Джек спит в шкафу. Она пытается сохранять оптимизм в отношении своего сына, но страдает от недоедания и депрессии. Она позволяет Джеку верить, что только Комната и ее содержимое реальны, а остальной мир существует только на телевидении.\n" +
