                "Старый Ник говорит Джой, что потерял работу и не сможет поставлять им припасы в будущем. Той ночью Джека переполняет любопытство, и он выходит из шкафа, пока Старый Ник спит в постели с Джой. Она приходит в ужас, когда просыпается и видит сына рядом со Старым Ником. В наказание за нападение тот урезает им тепло и электричество. Джой решает рассказать Джеку о внешнем мире; он реагирует с недоверием и непониманием, но также с любопытством. Джой подделывает Джеку болезненное состояние, надеясь, что Старый Ник отвезет его в больницу, где он сможет позвать на помощь, но Старый Ник говорит, что вернется на следующий день с антибиотиками.\n" +
                "\n" +
                "Джой заворачивает Джека в ковер и говорит ему прикинуться мертвым в надежде, что Старый Ник заберет его из Комнаты. Попавшись на уловку, Старый Ник кладет Джека в кузов своего пикапа и проезжает через жилой район. Хотя Джек ошеломлен своим первым знакомством с внешним миром, он выпрыгивает из грузовика и привлекает внимание прохожего. Приезжает полиция и спасает его. Полиция также обнаруживает Джой и доставляет ее и Джека в больницу. Старый Ник схвачен и арестован.\n" +
                "\n",

